M-as-a-judge approach, and verifies solutions and tests using a robust test framework. Additionally, the <b>SWE-MERA</b> leaderboard lets users choose issues from different time periods, making it easier to detect models affected by data contamination. <p>Benchmarks like SWE-bench are designed to evaluate the ability of AI systems to solve issues from real repositories. Each task comes with a reference solution and a test patch that allows one to verify correctness of the solution: the tests in this patch should fail before the solution is applied and successfully pass afterwards. SWE-bench has become a standard for evaluating large language models (LLMs) on programming tasks, particularly through its SWE-bench/Lite and SWE-bench/Verified subsets. However, since the benchmark is static and both the tasks and their solutions are publicly available, the risk of data contamination increases.</p>"},x2={ru:"Модель",eng:"Model"},_2={ru:"Позиция",eng:"Position"},S2={ru:"Задачи",eng:"Tasks"},R2={ru:"Ссылка",eng:"Trajectory"},q2={ru:"Данных за этот период нет",eng:"No data for this period"},L2={header:h2,home:C2,leaderboard:v2,headerBlockFirst:g2,textBlockFirst:D2,model:x2,position:_2,tasks:S2,trajectory:R2,notExistedData:q2},Q4=Object.freeze(Object.defineProperty({__proto__:null,default:L2,header:h2,headerBlockFirst:g2,home:C2,leaderboard:v2,model:x2,notExistedData:q2,position:_2,tasks:S2,textBlockFirst:D2,trajectory:R2},Symbol.toStringTag,{value:"Module"})),a1=(e,a)=>L2[e]?.[a]||"";var y4=I('<article class="description__text-wrapper svelte-16dx38b"><!></article>'),w4=I('<section class="description svelte-16dx38b"><!></section>');function u4(e,a){i1(a,!1);const d=oa("language");let c=V();const f=d.subscribe(i=>{g(c,i)});na(f),E1();var b=w4(),r=u(b);const o=r0(()=>a1("headerBlockFirst",n(c)));B4(r,{get headerBlock(){return n(o)},children:(i,t)=>{var p=y4(),B=u(p);xd(B,()=>a1("textBlockFirst",n(c))),_(i,p)},$$slots:{default:!0}}),_(e,b),t1()}const k4="modulepreload",h4=functi
